"1. Click the button on the lower right when powering on, and the color of the battery indicator on the lower left indicates the remaining battery power:
 Green light: >80% battery
 Yellow light: 20%~80% battery
 Red light: 10%~20% battery
 Blinking red: <10% battery

2. After the battery is fully charged, the indicator light goes out;

3. When the battery is exhausted, Bluetooth, ANC and other functions are not available, you can still listen to music by plugging in the headphone audio cable.

The Bluetooth of FIIL Wireless can connect up to 2 mobile phones / computers / Bluetooth devices at the same time, but can only receive music or calls from one of them at the same time;

5. " Also listening " mode means that when FIIL Wireless is not playing sound , you can clearly hear the surrounding sounds without removing the headphones;

6. Any sound from the connected device (music, phone, ringtone, prompt tone) will temporarily interrupt the " listen " mode; it will resume automatically after the sound stops ;

7. " HD Voice " can significantly improve call quality when using network voice chat (for example: WeChat voice chat, QQ phone, Skype call , etc.), mobile phone and carrier network support VoLTE call. "

